      content: >+
        [head=6]Служебная записка[/head]

        Кому: Всем сотрудникам службы безопасности Станции Центрального Командования


        От: Руководства Департамента Службы Безопасности 


        Тема: Памятка по уровням угрозы улик в хранилище улик СЦК


        Настоящая записка служит для информирования о классификации уровней угрозы для улик, хранящихся в хранилище улик Станции Центрального Командования.


        Уровни угрозы:


        1. [bold][color=green]Легкая опасность[/color]:[/bold]


        Улики не представляют особой опасности для жизни экипажа или целостности СЦК.

        Хранятся в сейфах улик легкой опасности.


        2.[bold][color=blue] Повышенная опасность:

        [/color][/bold]

        Улики, которые могут представлять прямую угрозу для жизни экипажа или целостности СЦК, а также особо ценное имущество, являющееся уликой.

        Хранятся в сейфах улик повышенной опасности.


        3. [bold][color=red]Высокая опасность:

        [/color][/bold]

        Вражеское снаряжение, взрывчатые вещества, токсичные вещества и иные улики, представляющие особый интерес или большую угрозу.

        Хранятся в сейфах улик высокой опасности.


        [bold][color=red]Важно:

        [/color]

        Вся информация о местонахождении и содержании улик строго конфиденциальна.

        Доступ к хранилищу улик разрешен только сотрудникам службы безопасности с соответствующим доступом.

        В случае возникновения вопросов по хранению улик, обращайтесь к начальнику службы безопасности СЦК.

        Просьба ознакомиться с данной памяткой и соблюдать установленные правила безопасности.[/bold]












