        [head=6]КРАТКОЕ ДОСЬЕ №14288

        [/head]

        [bold]ФИО: Калинов Лаврентий

        [/bold]


        Дата рождения: ■■■■ год, планета Земля, Солнечная система


        Номер личного дела: [bold]14288

        [/bold]


        Статус: [bold] [color=green]Активный[/color], [color=red]“Проект-124115-14288”[/color]

        [/bold]


        [bold]Профессия:

        [/bold]


        Ранее: Капитан флота НТ

        Текущая: Член кипаж Станции “■■■■■■■■■■” - уборщик

        Статус гражданства: Нет (отказался от гражданства после военного трибунала)


        [bold]Сведения о службе:

        [/bold]


        ОПЗ: ■■■■ - ■■■■ (Удостоен звание героя ОПЗ)

        Флот НТ: ■■■■ - ■■■■ (отчислен с позором)

        NanoTrasen: ■■■■ - ■■■■ (Уволен с позором)

        NanoTrasen (Проект-124115-14288): ■■■■ - по настоящее время


        [bold]Описание:

        [/bold]


        Калинов Лаврентий - гражданин (отказался от гражданства) с богатым военным прошлым. Ветеран многочисленных космических войн, герой ОПЗ, награжден Орденом “За отвагу”, прославившийся своими боевыми подвигами. После окончания войны, Калинов был принят на службу в НТ, где проявил себя как талантливый капитан, командовавший одним из лучших кораблей флота.


        [bold]Кризис:

        [/bold]


        В ■■■■ году жизнь Калинова круто изменилась. Он нарушил прямой приказ командования, отправившись на своем корабле спасать союзников, которые попали в ловушку. Спасение не удалось, корабль был уничтожен, а сам Калинов спасся с помощью спасательной капсулы. За нарушение приказа и потери корабля на него была повешена огромная сумма долга - стоимость уничтоженного корабля. В результате, он был уволен из флота НТ, а позже - и из НТ.


        [bold]Проект-124115-14288:

        [/bold]


        Калинов привлек внимание отдела исследований и разработок НТ. Его уникальная история и стойкость в условиях кризиса позволили ему стать объектом тайного эксперимента “Проект-124115-14288”. Цель проекта: изучение возможностей продления человеческой жизни без потери работоспособности.


        [bold]Состояние здоровья:

        [/bold]


        За более чем 320 лет эксперимента, Калинов подвергался многочисленным медицинским процедурам, включая реанимации и клонирование. В настоящее время у него диагностированы следующие проблемы:


        Лакунарная Деменция

        Проблемы с произношением

        Слуховые галлюцинации

        Посттравматический стрессовый синдром

        Провалы в памяти


        [bold]Комментарии:

        [/bold]


        Калинов Лаврентий [bold]заочно приговорён к смерти;[/bold] в случае риска раскрытия эксперимента [bold][color=red]должен быть немедленно устранён.[/color][/bold]


        Дополнительно:


        Дело хранится в архиве Департамента исследований и разработок НТ.

        [color=red]Доступ к делу ограничен.

        Доступ к сведениям о “Проекте-124115-14288” имеют только уполномоченные лица.

        [/color]













