      content: >+
        Личное Дело

        Номер: 17345-А


        Имя: Доктор Эндрю Картер


        Дата рождения: ⬛⬛.⬛⬛.⬛⬛⬛⬛


        Место рождения: ⬛⬛⬛⬛⬛ ⬛⬛⬛⬛⬛⬛⬛⬛⬛, Земля


        Образование: Медицинский Университет ⬛⬛⬛⬛⬛⬛⬛⬛⬛ (с отличием)


        Профессия: Главный Врач, Станция Центрального Командования


        Статус: Умер, устранён


        Детали:


        Доктор Эндрю Картер был выдающимся врачом, специализирующимся на биоинженерии и генетике. Он был назначен Главным Врачом Станции Центрального Командования после успешного завершения миссии на ⬛⬛⬛⬛⬛⬛, где он руководил созданием генетически модифицированного персонала, устойчивого к ⬛⬛⬛⬛⬛⬛ условиям ⬛⬛⬛⬛⬛⬛⬛⬛.


