      content: >-
        [head=3]Инструкция по стерилизации камер с больными.[/head]


        [color=red][bold]ПРИМЕНЯТЬ ТОЛЬКО В СЛУЧАЕ НЕОБХОДИМОСТИ ПО ПРЯМОМУ ПРИКАЗУ ГЛАВНОГО ВРАЧА СЦК ИЛИ НАЧАЛЬНИКА БЕЗОПАСНОСТИ СЦК.

        [/bold][/color]


        Шаг 1: Прикрутить канистры с плазмой и тритием и включить нагреватель, предварительно выставив на нем максимальную температуру.


        Шаг 2: Дождаться, пока температура плазмы будет равна 100 градусам и выше.


        Шаг 3: Отключить авторежим в воздушной сигнализации [color=red][bold] НУЖНОЙ КАМЕРЫ[/bold][/color].


        Шаг 4: Перевести воздушную сигнализацию[color=red][bold] НУЖНОЙ КАМЕРЫ[/bold][/color] в режим «Заполнение».[color=red][bold] Убедитесь, что все шлюзы, ведущие в камеры, закрыты. НЕ ОТКРЫВАЙТЕ ИХ ВО ВРЕМЯ ПРОЦЕССА.

        [/bold][/color]


        Шаг 5: Когда температура плазмы будет равна приверно 150 градусам, разблокируйте и прожмите кнопку сигнала. Это откроет клапан.


        Шаг 6: Когда камеры будут стерилизованы, нажмите кнопку еще раз для закрытия клапана, переведите воздушную сигнализацию в режим «Паника».


        Шаг 7: Когда из камер будут откачаны все газы, переключите воздушную сигнализацию в режим «Фильтрация» и включите авторежим.


        Шаг 8: Составьте отчет о стерилизации в течение 15 минут после завершения и передайте его НШЦК.
