      content: 'Умер Штирлиц. Подходит к воротам рая, а апостол Пётр его не пускает: дескать, грехов много, и нацистам служил, и безбожникам-коммунистам. Штирлиц начинает спорить. К ним подходит архангел Михаил. Узнав, в чем дело, устало машет рукой и говорит Пётру: - Пропусти. Мы все равно ничего не докажем.'
